      font-size: 16px;

      background-color: #e74c3c;
    }

    }

      background-color: #2980b9;
    }

      margin-top: 10px;
      font-size: 16px;
      border-radius: 5px;
      border: 1px solid #ccc;
      width: 390px;
      text-align: center;
    }
    #obfuscationBtn {
      background-color: #9b59b6;
    }
	.button-container {
    display: flex;
    flex-direction: column;
  }
